import styled from 'styled-components'
import QRcode from 'react-qr-code';

const Contact: React.FC = () => {

    return (
        <StyledContainer>
            <StyledInnerContainer>
                <StyledInnerGrouping>
            <QRcode size={75} value={"https://t.me/SamInTaiwan"} />
            <StyledLink target='_self' href="https://t.me/SamInTaiwan">Telegram</StyledLink>
            </StyledInnerGrouping>
            <StyledInnerGrouping>
            <QRcode size={75} value={"https://line.me/R/ti/p/samdepramere"} />
            <StyledLink target='_self' href="https://line.me/R/ti/p/samdepramere">Line</StyledLink>
            </StyledInnerGrouping>
            <StyledInnerGrouping>
            <QRcode size={75} value={"https://line.me/R/ti/p/samdepramere"} />
            <StyledLink target='_self' href="https://line.me/R/ti/p/samdepramere">WhatsApp</StyledLink>
            </StyledInnerGrouping>
            </StyledInnerContainer>
        </StyledContainer>
    )
}

const StyledContainer = styled.div`
display: flex;
flex-flow: column;
margin-left: auto;
margin-right: auto;
border-radius: 4px;
justify-content: center;
width: 80%;
height: 90%;
background-color: #008B8B;
`
const StyledInnerContainer = styled.div`
display: flex;
flex-flow: row;
margin-left: auto;
margin-right: auto;
justify-content: center;
width: 80%;
height: 15%;
`
const StyledLink = styled.a`
text-decoration: none;
color: unset;
cursor: pointer;
`
const StyledInnerGrouping = styled.div`
width: 33%;
height: 100px;
display: flex;
flex-direction: column;
align-items: center;
`

const StyledVerticalSpacer = styled.div`
width: 100%;
height: 50px;
`

export default Contact
